import styled from '@emotion/styled';
import GoodsItem from '@components/GoodsItem/GoodsItem';
import Button from '@components/Button/Button';
import useFilter from 'hooks/useFilter';
import { useState } from 'react';

const GiftRanking = () => {
  const GoodsImageLink = "https://st.kakaocdn.net/product/gift/product/20231030175450_53e90ee9708f45ffa45b3f7b4bc01c7c.jpg";

  // 21Í∞úÏùò ÏÉÅÌíàÏùÑ ÏÉùÏÑ±
  const items = Array.from({ length: 21 }, (_, index) => ({
    id: index + 1,
    rank: index + 1,
    corp: 'BBQ',
    name: `BBQ ÏñëÎÖêÏπòÌÇ®+ÌÅ¨Î¶ºÏπòÏ¶àÎ≥º+ÏΩúÎùº1.25L`,
    price: 29000,
    image: GoodsImageLink,
  }));

  const { filter, setFilter, subFilter, setSubFilter, filterItems } = useFilter(items);
  const [showMore, setShowMore] = useState(false);

  const displayedItems = showMore ? filterItems() : filterItems().slice(0, 6);

  return (
    <RankingContainer>
      <Title>Ïã§ÏãúÍ∞Ñ Í∏âÏÉÅÏäπ ÏÑ†Î¨ºÎû≠ÌÇπ</Title>
      <FilterContainer>
        <FilterButtonWrapper>
          <StyledButton onClick={() => setFilter('all')} active={filter === 'all'}>
            <FilterIcon>ALL</FilterIcon>
          </StyledButton>
          <FilterText active={filter === 'all'}>Ï†ÑÏ≤¥</FilterText>
        </FilterButtonWrapper>
        <FilterButtonWrapper>
          <StyledButton onClick={() => setFilter('female')} active={filter === 'female'}>
            <FilterIcon>üë©</FilterIcon>
          </StyledButton>
          <FilterText active={filter === 'female'}>Ïó¨ÏÑ±Ïù¥</FilterText>
        </FilterButtonWrapper>
        <FilterButtonWrapper>
          <StyledButton onClick={() => setFilter('male')} active={filter === 'male'}>
            <FilterIcon>üë®</FilterIcon>
          </StyledButton>
          <FilterText active={filter === 'male'}>ÎÇ®ÏÑ±Ïù¥</FilterText>
        </FilterButtonWrapper>
        <FilterButtonWrapper>
          <StyledButton onClick={() => setFilter('teen')} active={filter === 'teen'}>
            <FilterIcon>üßë</FilterIcon>
          </StyledButton>
          <FilterText active={filter === 'teen'}>Ï≤≠ÏÜåÎÖÑÏù¥</FilterText>
        </FilterButtonWrapper>
      </FilterContainer>
      <SubFilterContainer>
        <SubFilterButton onClick={() => setSubFilter('Î∞õÍ≥† Ïã∂Ïñ¥Ìïú')} active={subFilter === 'Î∞õÍ≥† Ïã∂Ïñ¥Ìïú'}>Î∞õÍ≥† Ïã∂Ïñ¥Ìïú</SubFilterButton>
        <SubFilterButton onClick={() => setSubFilter('ÎßéÏù¥ ÏÑ†Î¨ºÌïú')} active={subFilter === 'ÎßéÏù¥ ÏÑ†Î¨ºÌïú'}>ÎßéÏù¥ ÏÑ†Î¨ºÌïú</SubFilterButton>
        <SubFilterButton onClick={() => setSubFilter('ÏúÑÏãúÎ°ú Î∞õÏùÄ')} active={subFilter === 'ÏúÑÏãúÎ°ú Î∞õÏùÄ'}>ÏúÑÏãúÎ°ú Î∞õÏùÄ</SubFilterButton>
      </SubFilterContainer>
      <ItemsContainer>
        {displayedItems.map(item => (
          <GoodsItem
            key={item.id}
            subtitle={item.corp}
            title={item.name}
            imageSrc={item.image}
            amount={item.price}
            rankingIndex={item.rank}
          />
        ))}
      </ItemsContainer>
      <ButtonContainer>
        <StyledButton onClick={() => setShowMore(!showMore)}>
          {showMore ? 'Ï†ëÍ∏∞' : 'ÎçîÎ≥¥Í∏∞'}
        </StyledButton>
      </ButtonContainer>
    </RankingContainer>
  );
};

const RankingContainer = styled.div`
  padding: 20px;
  background-color: #fff;
  border-radius: 8px;
`;

const Title = styled.h2`
  font-size: 18px;
  font-weight: bold;
  margin-bottom: 20px;
`;

const FilterContainer = styled.div`
  display: flex;
  gap: 100px;
  margin-bottom: 20px;
  justify-content: center;
`;

const FilterButtonWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const StyledButton = styled(Button)<{ active?: boolean }>`
  display: flex;
  align-items: center;
  justify-content: center;
  width: 50px;
  height: 50px;
  border: none;
  border-radius: 20px;
  background-color: ${({ active }) => (active ? '#007aff' : '#e0f7fa')};
  color: ${({ active }) => (active ? '#fff' : '#333')};
  cursor: pointer;
`;

const FilterIcon = styled.span`
  font-size: 14px;
`;

const FilterText = styled.span<{ active: boolean }>`
  font-size: 14px;
  margin-top: 5px;
  color: ${({ active }) => (active ? '#007aff' : '#333')};
`;

const SubFilterContainer = styled.div`
  display: flex;
  gap: 20px;
  margin-bottom: 20px;
  background-color: #e0f7fa;
  padding: 10px;
  border-radius: 10px;
  justify-content: center;
`;

const SubFilterButton = styled(Button)<{ active?: boolean }>`
  background-color: transparent;
  color: ${({ active }) => (active ? '#007aff' : '#333')};
  cursor: pointer;
`;

const ItemsContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 20px;
`;

const ButtonContainer = styled.div`
  text-align: center;
  margin-top: 20px;
`;

export default GiftRanking;
